import React, { Component } from "react";
import { ReactComponent as Meta } from "../../assets/images/metamask.svg";

export default class MetaViewer extends Component {
  render() {
    const createViewer = require("../../..");

    createViewer({
      width: 0.4,
      height: 0.4,
      followMouse: true,
      followMotion: true,
    });
    return <div></div>;
  }
}
